import React, { useContext } from "react";
import { Dropdown } from "react-bootstrap";
import { Link, useNavigate } from "react-router-dom";
import UserRegisterContex from "../Store/UserRegisterContex";
export const Header = () => {
  const navigate = useNavigate();
  const [state, dispatch] = useContext(UserRegisterContex);
  const user = state.registerdata.find(
    (u) => u.email
  );
  const userLogout = () => {
    let userdata = {
      isLogin: false,
    };
    dispatch({
      type: "logoutUser",
      payload: userdata,
    });
    navigate("/");
  };
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
  <div className="container-fluid">
    <div className="collapse navbar-collapse" id="navbarSupportedContent">
      <ul className="navbar-nav me-auto mb-2 mb-lg-0 h3">
        <li className="nav-item">
        <Link to="/Homepage" className="nav-link">Home</Link>
        </li>
        <li className="nav-item">
        <Link to="/Features" className="nav-link">Features</Link>
        </li>
        <li className="nav-item">
        <Link to="/Aboutus" className="nav-link">About-Us</Link>
        </li>
      </ul>
      <Dropdown>
      <Dropdown.Toggle variant="success" id="dropdown-basic">
        Dropdown Button
      </Dropdown.Toggle>

      <Dropdown.Menu>
        <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
        <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
        <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
      </Dropdown.Menu>
    </Dropdown>
   
      <div className="d-flex">
      <ul className="navbar-nav mr-auto mb-0 h3 ">
      {
       <>
       <Dropdown>
       <Dropdown.Toggle variant="success" id="dropdown-basic">
       WelCome,{user.name}
      </Dropdown.Toggle>
      <Dropdown.Menu>
        <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
      </Dropdown.Menu>

       </Dropdown>
       <li className="nav-item dropdown">
          <a className="nav-link dropdown-toggle" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
          WelCome,{user.name}
          </a>
        <ul className="dropdown-menu" aria-labelledby="navbarDropdown">
       <li> 
          <a className="dropdown-item" onClick={userLogout}>
            <Link>Logout</Link>
          </a>
        </li>
        </ul>
        </li>
        </>}
      </ul>
      </div>
    </div>
  </div>
</nav>

  );
};
